  computed: {
    indexs: function indexs() {
      var left = 1;
      var right = this.all;
      var ar = [];

      if (this.all >= 5) {
        if (this.cur > 3 && this.cur < this.all - 2) {
          left = this.cur - 2;
          right = this.cur + 2;
        } else {
          if (this.cur <= 3) {
            left = 1;
            right = 5;
          } else {
            right = this.all;
            left = this.all - 4;
          }
        }

        while (left <= right) {
          ar.push(left);
          left++;
        }
      } else {
        left = 1;
        right = this.all;

        while (left <= right) {
          ar.push(left);
          left++;
        }
      }

      return ar;
    }
