      this.pickerOptions = {
        disabledDate: function disabledDate(date) {
          var end = new Date(val).getTime();
          var days = 60 * 24 * 60 * 60 * 1000;
          var beginDays = end - days;
          return date > end || date <= beginDays;
        }
      };
    }
